using RBot;

public class Script {

	public void ScriptMain(ScriptInterface bot){
		bot.Options.SafeTimings = true;
		bot.Options.RestPackets = true;
		
		bot.Skills.LoadSkills("Skills/generic.xml");
		bot.Skills.StartSkills("Skills/generic.xml");
		
		bot.Player.LoadBank();
		bot.Bank.ToInventory("doomcoin");
		bot.Bank.ToInventory("Dark Spirit Orb");
		bot.Player.RejectExceptFast("doomcoin", "dark spirit orb", "shadow creeper enchant");
		
		while(!bot.ShouldExit()){
			bot.Quests.EnsureAccept(2089);
			
			
			bot.Player.Join("maul-999999");
			bot.Player.Jump("r2","Left",false);
			bot.Player.HuntForItem("Slimeskull","DoomCoin",20,false,true);
			bot.Player.Pickup("DoomCoin");
			bot.Player.Jump("Enter","Spawn",false);
			bot.Quests.EnsureComplete(2089);
			
			bot.Wait.ForDrop("dark spirit orb");
			bot.Player.Pickup("dark spirit orb");
		}
	}
}
